import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="app">
        <h2 className="appTitle">Task Manager</h2>
        <div className="listWrapper">
            <h2 className="listTitle">Work</h2>
        </div>
      </div>
    );
  }
}

export default App;
